import React from "react";
import "../navbarWithToggle/NavbarToggle.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import togglerIcon from "../images/togglerIcon.svg";
import Scrollspy from "react-scrollspy";
import { Link, animatedScroll as scroll } from "react-scroll";
const NavbarToggle = () => {
  return (
    <div className="navbar">
      <div className="mobileNav d-md-flex justify-content-center">
        <input className="menu-btn" type="checkbox" id="menu-btn"></input>
        <label className="menu-icon" htmlFor="menu-btn">
          <span className="navicon"></span>
        </label>
        <ul className="menu">
          <li className="menu-link">
            <Link
              activeClass="active"
              to="service"
              spy={true}
              smooth={true}
              duration={3000}
            >
              <a href="#service">SERVICES</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="projects"
              spy={true}
              smooth={true}
              duration={3000}
            >
              <a href="#projects">PROJECTS</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="timeline"
              spy={true}
              smooth={true}
              duration={3000}
            >
              <a href="#timeline">TIMELINE</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="team"
              spy={true}
              smooth={true}
              duration={3000}
            >
              <a href="#team">TEAM</a>
            </Link>
          </li>
          <li className="menu-link">
            <Link
              activeClass="active"
              to="contact"
              spy={true}
              smooth={true}
              duration={3000}
            >
              <a href="#contact">CONTACT</a>
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default NavbarToggle;
